import React from 'react';
import '../styles/st'
const AboutUs = () => {
  return (
    <section className="about" id="about">
      <div className="content">
        <h2>About Us</h2>
        <p>Welcome to our Orphanage Support Platform! We are a dedicated team of individuals passionate about making a positive impact on the lives of orphaned children and elderly individuals in old age homes. Our mission is to create a centralized platform that connects well-wishers, families, and mentors with orphanages and care facilities, fostering a strong community of support.</p>
      </div>
      <div className="image">
        <img src="../images/aboutus.jpg" alt="About Us" />
      </div>
    </section>
  );
}

export default AboutUs;
